import React from "react";
import {Wrap, Logo, HeaderItems, HeaderItem} from "../styles/Header"

function Header() {
  return (

    <Wrap>
      <div className="container">
      <HeaderContainer>
      <Logo>Logo</Logo>
      <HeaderItems>
        <HeaderItem>1</HeaderItem>
        <HeaderItem>2</HeaderItem>
        <HeaderItem>3</HeaderItem>
      </HeaderItems>
      </HeaderContainer>
      </div>
    </Wrap>
  );
}

export default Header;
